import React from "react";
import Pokemon from "../pokemon/Pokemon";
import { useSelector } from "react-redux";
import "./Pokemons.css";

export default function Pokemons({ currentPokemons }) {
  const pokemons = useSelector((state) => state.pokemons);
  const pokemonBuscados = useSelector((state) => state.pokemonsBuscados);



  //console.log(pokemons[0]?.types);
  console.log("Estoy en Pokemons ", pokemons);

  return (
    <div>
      {
        console.log("ENTRE AL MAP"),

        pokemonsBuscados &&
        <div>
          <Pokemon
            id={pokemonsBuscados.id}
            name={pokemonsBuscados.name}
            img={pokemonsBuscados.img}
            types={pokemonsBuscados.types}
          />
        </div>
      }
      {
          currentPokemons.map((poke) => {
            return (
              <div className="cards" key={poke}>
                <Pokemon
                  id={poke.id}
                  name={poke.name}
                  img={poke.img}
                  types={poke.types}
                />
              </div>
            );
          })



      }
    </div>
  );
}
